package java_fun.epn.practica4;

public class Trailer extends Vehiculo{

	private String tipo;
	
	public Trailer() {
		super();
		tipo="Trailer";
		// TODO Auto-generated constructor stub
	}

	public String toString() {
		return "Trailer [getColor()=" + getColor() + ", getPlaca()="
				+ getPlaca() + ", getMarca()=" + getMarca() + ", getModelo()="
				+ getModelo() + ", hashCode()="
				+ hashCode() +"]";
	}
	
	

}
